                    <div className='box_bd d-flex'>
                        <div className='box_d1'>2022 Stammerers Connect</div>
                        <div className='box_d2'>Privacy Policy</div>
                        <div className='box_d3'>Terms and Conditions</div>
                    </div>
                </div>

            </footer>
        </div>
        // </div>
       
    )
}
